import React from 'react';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import '../HomeComponent/home.css';
import stock from '../../assests/stock1.png'

export default function home() {
	const settings = {
		dots: false,
		infinite: true,
		speed: 500,
		slidesToShow: 1,
		slidesToScroll: 1,
		autoplay: true,
    speed: 2000
	};
	return (
		<div className="hm-banner-section">
			<Slider {...settings}>
				<div className="stock_sec_image">
					<img src={stock} alt="stock-section1"/>
					1
				</div>
				<div className="stock_sec_image">
					<img src={stock} alt="stock-section1"/>
					2
				</div>
			</Slider>
		</div>
		)
	}
